var roles = [];
var client = keycloakSession.getContext().getClient();
user.getRoleMappings().forEach(function(roleModel) {
    roles.push(roleModel.getName());

    isComposite = roleModel.isComposite();
    if (isComposite) {
        roleModel.getComposites().forEach(function(child) {
           roles.push(child.getName()); 
        });
    }
});

token.setOtherClaims("client_roles", Java.to(roles, "java.lang.String[]"));
